import { BrowserRouter, Route, Switch } from "react-router-dom";
import "./App.css";
import Header from "./components/header/Header";

// 21ms59ss
import HomePage from "./pages/homepage/HomePage";
import SongListPage from "./pages/songs/SongListPage";
import UserListPage from "./pages/users/UserListPage";
import SongAddPage from "./pages/songs/SongAddPage";

//src1, 
function App() {
  render()
  {return (
    // 13ms43ss
    <BrowserRouter>
      <Header />

      {/* 14ms29ss */}
      <Switch>
        {/* 14ms39ss. 15ms49ss */}
        <Route exact path='/' components={HomePage}></Route>
        <Route path='/user-list' components={UserListPage}></Route>
        <Route path='/song-add' components={SongAddPage}></Route>
        <Route path='/song-list' components={SongListPage}></Route>
      </Switch>
    </BrowserRouter>
  )}

  // return (
  //   <div className="App">
  //     <UserList />
  //     <div className="ui divider"></div>
  //     <SongAdd />
  //     <div className="ui divider"></div>
  //     <SongList />
  //   </div>
  // );
}

export default App;
